import React from 'react';
import './App.css';
import { Formulario } from './components/Formulario';
import { FraseMotivacional } from './components/FraseMotivacional';
import { FrasesMotivacionaisContextModel } from './model';

export const FraseMotivacionalContext = React.createContext<FrasesMotivacionaisContextModel>("");

function App() {

  return (
    <FraseMotivacionalContext.Provider value="É hora de esquecer os erros do passado e começar a planejar os erros do futuro."> 
      <FraseMotivacional />
      <h2>Calculadora de IMC</h2><br />
      <Formulario/>
    </FraseMotivacionalContext.Provider>
  );
}


export default App;
